contracts/ArbitrageBot.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

/**
 * @title ArbitrageBot
 * @dev Smart contract for LokiAI Arbitrage Trading Agent
 * Identifies and executes arbitrage opportunities across DEXs
 */
contract ArbitrageBot is Ownable, ReentrancyGuard {
    
    // Events
    event ArbitrageExecuted(
        address indexed executor,
        address indexed tokenA,
        address indexed tokenB,
        uint256 amountIn,
        uint256 amountOut,
        uint256 profit,
        string dexA,
        string dexB,
        uint256 timestamp
    );
    
    event OpportunityDetected(
        address indexed tokenA,
        address indexed tokenB,
        uint256 priceA,
        uint256 priceB,
        uint256 profitPotential,
        string dexA,
        string dexB,
        uint256 timestamp
    );
    
    event DexAdded(string name, address router, bool active);
    event DexUpdated(string name, bool active);
    
    // Structs
    struct ArbitrageOpportunity {
        address tokenA;
        address tokenB;
        uint256 priceA;
        uint256 priceB;
        uint256 profitPotential;
        string dexA;
        string dexB;
        uint256 timestamp;
        bool executed;
    }
    
    struct DexInfo {
        string name;
        address router;
        uint256 fee; // in basis points
        bool active;
    }
    
    struct TradeResult {
        uint256 amountIn;
        uint256 amountOut;
        uint256 profit;
        uint256 gasUsed;
        bool success;
    }
    
    // State variables
    mapping(string => DexInfo) public dexes;
    mapping(bytes32 => ArbitrageOpportunity) public opportunities;
    mapping(address => uint256) public userProfits;
    
    string[] public availableDexes;
    bytes32[] public opportunityIds;
    
    uint256 public totalArbitrageVolume;
    uint256 public totalProfitGenerated;
    uint256 public totalTradesExecuted;
    uint256 public performanceFee = 50; // 0.5% in basis points
    uint256 public minProfitThreshold = 1e16; // 0.01 ETH minimum profit
    
    address public feeRecipient;
    
    constructor(address _feeRecipient) Ownable(msg.sender) {
        feeRecipient = _feeRecipient;
        
        // Initialize with mock DEXs
        _addDex("Uniswap V2", address(0x10), 30, true);
        _addDex("Sushiswap", address(0x20), 30, true);
        _addDex("PancakeSwap", address(0x30), 25, true);
        _addDex("Curve", address(0x40), 4, true);
    }
    
    /**
     * @dev Execute arbitrage between two DEXs
     * @param tokenA First token in the pair
     * @param tokenB Second token in the pair
     * @param amount Amount to arbitrage
     * @param dexA Source DEX
     * @param dexB Target DEX
     * @return profit The profit generated
     */
    function executeArbitrage(
        address tokenA,
        address tokenB,
        uint256 amount,
        string memory dexA,
        string memory dexB
    ) external nonReentrant returns (uint256 profit) {
        require(tokenA != address(0) && tokenB != address(0), "Invalid token addresses");
        require(amount > 0, "Amount must be greater than 0");
        require(dexes[dexA].active && dexes[dexB].active, "DEX not active");
        
        // Calculate potential profit (mock implementation)
        uint256 priceA = _getPrice(tokenA, tokenB, dexA);
        uint256 priceB = _getPrice(tokenA, tokenB, dexB);
        
        require(priceA != priceB, "No arbitrage opportunity");
        
        // Execute arbitrage (mock implementation)
        TradeResult memory result = _executeArbitrageTrade(tokenA, tokenB, amount, dexA, dexB);
        
        require(result.success, "Arbitrage execution failed");
        require(result.profit >= minProfitThreshold, "Profit below threshold");
        
        // Update metrics
        totalArbitrageVolume += amount;
        totalProfitGenerated += result.profit;
        totalTradesExecuted++;
        userProfits[msg.sender] += result.profit;
        
        emit ArbitrageExecuted(
            msg.sender,
            tokenA,
            tokenB,
            result.amountIn,
            result.amountOut,
            result.profit,
            dexA,
            dexB,
            block.timestamp
        );
        
        return result.profit;
    }
    
    /**
     * @dev Detect arbitrage opportunities (mock implementation)
     * @param tokenA First token
     * @param tokenB Second token
     * @return hasOpportunity Whether opportunity exists
     * @return profitPotential Potential profit amount
     */
    function detectOpportunity(
        address tokenA,
        address tokenB
    ) external returns (bool hasOpportunity, uint256 profitPotential) {
        require(tokenA != address(0) && tokenB != address(0), "Invalid token addresses");
        
        uint256 bestBuyPrice = type(uint256).max;
        uint256 bestSellPrice = 0;
        string memory buyDex = "";
        string memory sellDex = "";
        
        // Check prices across all active DEXs
        for (uint i = 0; i < availableDexes.length; i++) {
            string memory dexName = availableDexes[i];
            if (!dexes[dexName].active) continue;
            
            uint256 price = _getPrice(tokenA, tokenB, dexName);
            
            if (price < bestBuyPrice) {
                bestBuyPrice = price;
                buyDex = dexName;
            }
            
            if (price > bestSellPrice) {
                bestSellPrice = price;
                sellDex = dexName;
            }
        }
        
        // Calculate profit potential
        if (bestSellPrice > bestBuyPrice) {
            profitPotential = bestSellPrice - bestBuyPrice;
            hasOpportunity = profitPotential >= minProfitThreshold;
            
            if (hasOpportunity) {
                // Store opportunity
                bytes32 opportunityId = keccak256(abi.encodePacked(
                    tokenA, tokenB, block.timestamp, block.number
                ));
                
                opportunities[opportunityId] = ArbitrageOpportunity({
                    tokenA: tokenA,
                    tokenB: tokenB,
                    priceA: bestBuyPrice,
                    priceB: bestSellPrice,
                    profitPotential: profitPotential,
                    dexA: buyDex,
                    dexB: sellDex,
                    timestamp: block.timestamp,
                    executed: false
                });
                
                opportunityIds.push(opportunityId);
                
                emit OpportunityDetected(
                    tokenA,
                    tokenB,
                    bestBuyPrice,
                    bestSellPrice,
                    profitPotential,
                    buyDex,
                    sellDex,
                    block.timestamp
                );
            }
        }
        
        return (hasOpportunity, profitPotential);
    }
    
    /**
     * @dev Get mock price for token pair on specific DEX
     */
    function _getPrice(
        address tokenA,
        address tokenB,
        string memory dexName
    ) internal view returns (uint256) {
        // Mock price calculation with some variance
        uint256 basePrice = 1e18; // 1:1 base ratio
        
        // Add DEX-specific variance
        bytes32 dexHash = keccak256(abi.encodePacked(dexName));
        uint256 dexVariance = uint256(dexHash) % 1000; // 0-0.1% variance
        
        // Add token-specific variance
        bytes32 tokenHash = keccak256(abi.encodePacked(tokenA, tokenB));
        uint256 tokenVariance = uint256(tokenHash) % 2000; // 0-0.2% variance
        
        // Add time-based variance
        uint256 timeVariance = (block.timestamp % 500); // 0-0.05% variance
        
        return basePrice + dexVariance + tokenVariance + timeVariance;
    }
    
    /**
     * @dev Execute arbitrage trade (mock implementation)
     */
    function _executeArbitrageTrade(
        address tokenA,
        address tokenB,
        uint256 amount,
        string memory dexA,
        string memory dexB
    ) internal returns (TradeResult memory) {
        // Mock execution logic
        uint256 priceA = _getPrice(tokenA, tokenB, dexA);
        uint256 priceB = _getPrice(tokenA, tokenB, dexB);
        
        uint256 amountOut = (amount * priceB) / priceA;
        uint256 profit = amountOut > amount ? amountOut - amount : 0;
        
        // Deduct fees
        uint256 feeA = (amount * dexes[dexA].fee) / 10000;
        uint256 feeB = (amountOut * dexes[dexB].fee) / 10000;
        profit = profit > (feeA + feeB) ? profit - feeA - feeB : 0;
        
        return TradeResult({
            amountIn: amount,
            amountOut: amountOut,
            profit: profit,
            gasUsed: 150000, // Mock gas usage
            success: profit >= minProfitThreshold
        });
    }
    
    /**
     * @dev Add a new DEX
     */
    function addDex(
        string memory name,
        address router,
        uint256 fee
    ) external onlyOwner {
        _addDex(name, router, fee, true);
    }
    
    function _addDex(
        string memory name,
        address router,
        uint256 fee,
        bool active
    ) internal {
        require(router != address(0), "Invalid router address");
        require(fee <= 1000, "Fee too high"); // Max 10%
        
        dexes[name] = DexInfo({
            name: name,
            router: router,
            fee: fee,
            active: active
        });
        
        availableDexes.push(name);
        
        emit DexAdded(name, router, active);
    }
    
    /**
     * @dev Update DEX status
     */
    function updateDex(string memory name, bool active) external onlyOwner {
        require(bytes(dexes[name].name).length > 0, "DEX does not exist");
        dexes[name].active = active;
        
        emit DexUpdated(name, active);
    }
    
    /**
     * @dev Get available DEXs
     */
    function getAvailableDexes() external view returns (string[] memory) {
        return availableDexes;
    }
    
    /**
     * @dev Get DEX info
     */
    function getDexInfo(string memory name) external view returns (DexInfo memory) {
        return dexes[name];
    }
    
    /**
     * @dev Get recent opportunities
     */
    function getRecentOpportunities(uint256 count) external view returns (ArbitrageOpportunity[] memory) {
        uint256 length = opportunityIds.length;
        uint256 returnCount = count > length ? length : count;
        
        ArbitrageOpportunity[] memory recent = new ArbitrageOpportunity[](returnCount);
        
        for (uint256 i = 0; i < returnCount; i++) {
            bytes32 id = opportunityIds[length - 1 - i];
            recent[i] = opportunities[id];
        }
        
        return recent;
    }
    
    /**
     * @dev Update minimum profit threshold
     */
    function updateMinProfitThreshold(uint256 _threshold) external onlyOwner {
        minProfitThreshold = _threshold;
    }
    
    /**
     * @dev Update performance fee
     */
    function updatePerformanceFee(uint256 _fee) external onlyOwner {
        require(_fee <= 1000, "Fee cannot exceed 10%");
        performanceFee = _fee;
    }
    
    /**
     * @dev Get contract statistics
     */
    function getStats() external view returns (
        uint256 _totalVolume,
        uint256 _totalProfit,
        uint256 _totalTrades,
        uint256 _activeDexes
    ) {
        uint256 activeCount = 0;
        for (uint i = 0; i < availableDexes.length; i++) {
            if (dexes[availableDexes[i]].active) {
                activeCount++;
            }
        }
        
        return (totalArbitrageVolume, totalProfitGenerated, totalTradesExecuted, activeCount);
    }
}

contracts/PortfolioRebalancer.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

/**
 * @title PortfolioRebalancer
 * @dev Smart contract for LokiAI Portfolio Rebalancing Agent
 * Automatically rebalances portfolios to maintain target allocations
 */
contract PortfolioRebalancer is Ownable, ReentrancyGuard {
    
    // Events
    event PortfolioRebalanced(
        address indexed user,
        uint256 totalValue,
        uint256 rebalanceAmount,
        uint256 gasCost,
        uint256 timestamp
    );
    
    event AllocationUpdated(
        address indexed user,
        address indexed token,
        uint256 oldAllocation,
        uint256 newAllocation,
        uint256 timestamp
    );
    
    event RebalanceTriggered(
        address indexed user,
        string reason,
        uint256 deviation,
        uint256 threshold,
        uint256 timestamp
    );
    
    event StrategyCreated(
        address indexed user,
        string strategyName,
        uint256 strategyId,
        uint256 timestamp
    );
    
    // Structs
    struct Allocation {
        address token;
        uint256 targetPercentage; // in basis points (10000 = 100%)
        uint256 currentPercentage;
        uint256 currentValue;
        uint256 deviation;
    }
    
    struct RebalanceStrategy {
        string name;
        uint256 rebalanceThreshold; // in basis points
        uint256 minRebalanceAmount;
        bool autoRebalance;
        uint256 lastRebalance;
        bool active;
    }
    
    struct Portfolio {
        Allocation[] allocations;
        uint256 totalValue;
        uint256 strategyId;
        uint256 lastRebalance;
        uint256 rebalanceCount;
    }
    
    struct RebalanceAction {
        address tokenFrom;
        address tokenTo;
        uint256 amount;
        string action; // "BUY" or "SELL"
    }
    
    // State variables
    mapping(address => Portfolio) public userPortfolios;
    mapping(address => RebalanceStrategy) public userStrategies;
    mapping(uint256 => RebalanceStrategy) public strategies;
    mapping(address => RebalanceAction[]) public pendingRebalances;
    
    uint256 public nextStrategyId = 1;
    uint256 public totalRebalances;
    uint256 public totalValueRebalanced;
    uint256 public defaultRebalanceThreshold = 500; // 5%
    uint256 public minRebalanceAmount = 1e16; // 0.01 ETH
    uint256 public performanceFee = 75; // 0.75% in basis points
    
    address public feeRecipient;
    
    // Predefined strategies
    string[] public availableStrategies = [
        "Conservative",
        "Balanced",
        "Aggressive",
        "DeFi Focus",
        "Stablecoin Heavy"
    ];
    
    constructor(address _feeRecipient) Ownable(msg.sender) {
        feeRecipient = _feeRecipient;
        
        // Initialize default strategies
        _initializeDefaultStrategies();
    }
    
    /**
     * @dev Rebalance user's portfolio
     * @param user The user address to rebalance
     * @return rebalanced Whether rebalancing was performed
     * @return totalValue The total portfolio value
     */
    function rebalancePortfolio(address user) external nonReentrant returns (bool rebalanced, uint256 totalValue) {
        require(user != address(0), "Invalid user address");
        
        Portfolio storage portfolio = userPortfolios[user];
        require(portfolio.allocations.length > 0, "No portfolio found");
        
        // Calculate current allocations and deviations
        _updateCurrentAllocations(user);
        
        // Check if rebalancing is needed
        (bool needsRebalance, uint256 maxDeviation, string memory reason) = _checkRebalanceNeeded(user);
        
        if (!needsRebalance) {
            return (false, portfolio.totalValue);
        }
        
        // Execute rebalancing
        RebalanceAction[] memory actions = _calculateRebalanceActions(user);
        uint256 rebalanceAmount = _executeRebalanceActions(user, actions);
        
        // Update portfolio state
        portfolio.lastRebalance = block.timestamp;
        portfolio.rebalanceCount++;
        
        // Update global metrics
        totalRebalances++;
        totalValueRebalanced += rebalanceAmount;
        
        emit RebalanceTriggered(user, reason, maxDeviation, defaultRebalanceThreshold, block.timestamp);
        emit PortfolioRebalanced(user, portfolio.totalValue, rebalanceAmount, 0, block.timestamp);
        
        return (true, portfolio.totalValue);
    }
    
    /**
     * @dev Create a custom rebalancing strategy for user
     * @param user The user address
     * @param strategyName Name of the strategy
     * @param allocations Array of target allocations
     * @param rebalanceThreshold Threshold for triggering rebalance
     * @param autoRebalance Whether to auto-rebalance
     */
    function createStrategy(
        address user,
        string memory strategyName,
        Allocation[] memory allocations,
        uint256 rebalanceThreshold,
        bool autoRebalance
    ) external returns (uint256 strategyId) {
        require(user != address(0), "Invalid user address");
        require(allocations.length > 0, "No allocations provided");
        require(rebalanceThreshold <= 5000, "Threshold too high"); // Max 50%
        
        // Validate allocations sum to 100%
        uint256 totalAllocation = 0;
        for (uint i = 0; i < allocations.length; i++) {
            totalAllocation += allocations[i].targetPercentage;
        }
        require(totalAllocation == 10000, "Allocations must sum to 100%");
        
        strategyId = nextStrategyId++;
        
        // Create strategy
        strategies[strategyId] = RebalanceStrategy({
            name: strategyName,
            rebalanceThreshold: rebalanceThreshold,
            minRebalanceAmount: minRebalanceAmount,
            autoRebalance: autoRebalance,
            lastRebalance: 0,
            active: true
        });
        
        // Create portfolio
        Portfolio storage portfolio = userPortfolios[user];
        portfolio.strategyId = strategyId;
        portfolio.lastRebalance = block.timestamp;
        portfolio.rebalanceCount = 0;
        
        // Set allocations
        delete portfolio.allocations;
        for (uint i = 0; i < allocations.length; i++) {
            portfolio.allocations.push(allocations[i]);
        }
        
        emit StrategyCreated(user, strategyName, strategyId, block.timestamp);
        
        return strategyId;
    }
    
    /**
     * @dev Update current allocations and calculate deviations
     */
    function _updateCurrentAllocations(address user) internal {
        Portfolio storage portfolio = userPortfolios[user];
        uint256 totalValue = 0;
        
        // Calculate total portfolio value (mock implementation)
        for (uint i = 0; i < portfolio.allocations.length; i++) {
            // Mock current value calculation
            uint256 currentValue = _getMockTokenValue(portfolio.allocations[i].token);
            portfolio.allocations[i].currentValue = currentValue;
            totalValue += currentValue;
        }
        
        portfolio.totalValue = totalValue;
        
        // Calculate current percentages and deviations
        if (totalValue > 0) {
            for (uint i = 0; i < portfolio.allocations.length; i++) {
                uint256 currentPercentage = (portfolio.allocations[i].currentValue * 10000) / totalValue;
                portfolio.allocations[i].currentPercentage = currentPercentage;
                
                // Calculate deviation
                uint256 target = portfolio.allocations[i].targetPercentage;
                uint256 deviation = currentPercentage > target ? 
                    currentPercentage - target : 
                    target - currentPercentage;
                portfolio.allocations[i].deviation = deviation;
            }
        }
    }
    
    /**
     * @dev Check if rebalancing is needed
     */
    function _checkRebalanceNeeded(address user) internal view returns (bool needed, uint256 maxDeviation, string memory reason) {
        Portfolio storage portfolio = userPortfolios[user];
        RebalanceStrategy storage strategy = strategies[portfolio.strategyId];
        
        if (!strategy.active) {
            return (false, 0, "Strategy inactive");
        }
        
        // Check time-based rebalancing (monthly)
        if (block.timestamp - portfolio.lastRebalance > 30 days) {
            return (true, 0, "Monthly rebalance");
        }
        
        // Check deviation-based rebalancing
        maxDeviation = 0;
        for (uint i = 0; i < portfolio.allocations.length; i++) {
            if (portfolio.allocations[i].deviation > maxDeviation) {
                maxDeviation = portfolio.allocations[i].deviation;
            }
        }
        
        if (maxDeviation >= strategy.rebalanceThreshold) {
            return (true, maxDeviation, "Deviation threshold exceeded");
        }
        
        // Check minimum rebalance amount
        if (portfolio.totalValue < strategy.minRebalanceAmount) {
            return (false, maxDeviation, "Below minimum rebalance amount");
        }
        
        return (false, maxDeviation, "No rebalancing needed");
    }
    
    /**
     * @dev Calculate rebalance actions needed
     */
    function _calculateRebalanceActions(address user) internal view returns (RebalanceAction[] memory) {
        Portfolio storage portfolio = userPortfolios[user];
        RebalanceAction[] memory actions = new RebalanceAction[](portfolio.allocations.length * 2);
        uint256 actionCount = 0;
        
        for (uint i = 0; i < portfolio.allocations.length; i++) {
            Allocation storage allocation = portfolio.allocations[i];
            
            if (allocation.currentPercentage > allocation.targetPercentage) {
                // Need to sell some of this token
                uint256 excessValue = ((allocation.currentPercentage - allocation.targetPercentage) * portfolio.totalValue) / 10000;
                
                actions[actionCount] = RebalanceAction({
                    tokenFrom: allocation.token,
                    tokenTo: address(0), // Will be determined later
                    amount: excessValue,
                    action: "SELL"
                });
                actionCount++;
            } else if (allocation.currentPercentage < allocation.targetPercentage) {
                // Need to buy more of this token
                uint256 deficitValue = ((allocation.targetPercentage - allocation.currentPercentage) * portfolio.totalValue) / 10000;
                
                actions[actionCount] = RebalanceAction({
                    tokenFrom: address(0), // Will be determined later
                    tokenTo: allocation.token,
                    amount: deficitValue,
                    action: "BUY"
                });
                actionCount++;
            }
        }
        
        // Resize array to actual count
        RebalanceAction[] memory finalActions = new RebalanceAction[](actionCount);
        for (uint i = 0; i < actionCount; i++) {
            finalActions[i] = actions[i];
        }
        
        return finalActions;
    }
    
    /**
     * @dev Execute rebalance actions (mock implementation)
     */
    function _executeRebalanceActions(address user, RebalanceAction[] memory actions) internal returns (uint256 totalAmount) {
        totalAmount = 0;
        
        for (uint i = 0; i < actions.length; i++) {
            // Mock execution - in real implementation, would interact with DEXs
            totalAmount += actions[i].amount;
            
            // Store pending action for tracking
            pendingRebalances[user].push(actions[i]);
        }
        
        return totalAmount;
    }
    
    /**
     * @dev Get mock token value (for testing)
     */
    function _getMockTokenValue(address token) internal view returns (uint256) {
        // Mock value calculation with some variance
        uint256 baseValue = 1000e18; // 1000 tokens worth
        uint256 variance = uint256(keccak256(abi.encodePacked(token, block.timestamp))) % 200e18;
        return baseValue + variance;
    }
    
    /**
     * @dev Initialize default strategies
     */
    function _initializeDefaultStrategies() internal {
        // Conservative Strategy
        strategies[1] = RebalanceStrategy({
            name: "Conservative",
            rebalanceThreshold: 1000, // 10%
            minRebalanceAmount: 1e17, // 0.1 ETH
            autoRebalance: true,
            lastRebalance: 0,
            active: true
        });
        
        // Balanced Strategy
        strategies[2] = RebalanceStrategy({
            name: "Balanced",
            rebalanceThreshold: 500, // 5%
            minRebalanceAmount: 5e16, // 0.05 ETH
            autoRebalance: true,
            lastRebalance: 0,
            active: true
        });
        
        // Aggressive Strategy
        strategies[3] = RebalanceStrategy({
            name: "Aggressive",
            rebalanceThreshold: 250, // 2.5%
            minRebalanceAmount: 1e16, // 0.01 ETH
            autoRebalance: true,
            lastRebalance: 0,
            active: true
        });
        
        nextStrategyId = 4;
    }
    
    /**
     * @dev Update allocation for user
     */
    function updateAllocation(
        address user,
        address token,
        uint256 newTargetPercentage
    ) external {
        Portfolio storage portfolio = userPortfolios[user];
        
        for (uint i = 0; i < portfolio.allocations.length; i++) {
            if (portfolio.allocations[i].token == token) {
                uint256 oldAllocation = portfolio.allocations[i].targetPercentage;
                portfolio.allocations[i].targetPercentage = newTargetPercentage;
                
                emit AllocationUpdated(user, token, oldAllocation, newTargetPercentage, block.timestamp);
                break;
            }
        }
    }
    
    /**
     * @dev Get user portfolio
     */
    function getUserPortfolio(address user) external view returns (
        Allocation[] memory allocations,
        uint256 totalValue,
        uint256 strategyId,
        uint256 lastRebalance,
        uint256 rebalanceCount
    ) {
        Portfolio storage portfolio = userPortfolios[user];
        return (
            portfolio.allocations,
            portfolio.totalValue,
            portfolio.strategyId,
            portfolio.lastRebalance,
            portfolio.rebalanceCount
        );
    }
    
    /**
     * @dev Get strategy details
     */
    function getStrategy(uint256 strategyId) external view returns (RebalanceStrategy memory) {
        return strategies[strategyId];
    }
    
    /**
     * @dev Get available strategies
     */
    function getAvailableStrategies() external view returns (string[] memory) {
        return availableStrategies;
    }
    
    /**
     * @dev Update default rebalance threshold
     */
    function updateDefaultThreshold(uint256 _threshold) external onlyOwner {
        require(_threshold <= 5000, "Threshold too high");
        defaultRebalanceThreshold = _threshold;
    }
    
    /**
     * @dev Update performance fee
     */
    function updatePerformanceFee(uint256 _fee) external onlyOwner {
        require(_fee <= 1000, "Fee cannot exceed 10%");
        performanceFee = _fee;
    }
    
    /**
     * @dev Get contract statistics
     */
    function getStats() external view returns (
        uint256 _totalRebalances,
        uint256 _totalValueRebalanced,
        uint256 _activeStrategies,
        uint256 _totalUsers
    ) {
        // Count active strategies (simplified)
        uint256 activeStrategies = 3; // Default strategies
        uint256 totalUsers = 0; // Would need proper counting
        
        return (totalRebalances, totalValueRebalanced, activeStrategies, totalUsers);
    }
}

contracts/RiskManager.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";

/**
 * @title RiskManager
 * @dev Smart contract for LokiAI Risk Management Agent
 * Monitors and manages portfolio risk across DeFi positions
 */
contract RiskManager is Ownable, ReentrancyGuard {
    
    // Events
    event RiskAssessed(
        address indexed user,
        uint256 riskScore,
        string riskLevel,
        uint256 portfolioValue,
        uint256 timestamp
    );
    
    event RiskAlert(
        address indexed user,
        string alertType,
        uint256 currentRisk,
        uint256 threshold,
        string recommendation,
        uint256 timestamp
    );
    
    event PositionLiquidated(
        address indexed user,
        address indexed token,
        uint256 amount,
        string reason,
        uint256 timestamp
    );
    
    event RiskParametersUpdated(
        uint256 maxRiskScore,
        uint256 liquidationThreshold,
        uint256 warningThreshold
    );
    
    // Structs
    struct RiskAssessment {
        uint256 riskScore;
        string riskLevel;
        uint256 portfolioValue;
        uint256 volatilityScore;
        uint256 concentrationRisk;
        uint256 liquidityRisk;
        uint256 timestamp;
    }
    
    struct Position {
        address token;
        uint256 amount;
        uint256 value;
        string protocol;
        uint256 entryTime;
        uint256 riskWeight;
    }
    
    struct RiskMetrics {
        uint256 totalValue;
        uint256 riskScore;
        uint256 diversificationScore;
        uint256 liquidityScore;
        uint256 volatilityScore;
        uint256 protocolRiskScore;
    }
    
    // State variables
    mapping(address => RiskAssessment) public userRiskAssessments;
    mapping(address => Position[]) public userPositions;
    mapping(address => RiskMetrics) public userRiskMetrics;
    mapping(address => bool) public riskAlerts;
    
    // Risk parameters
    uint256 public maxRiskScore = 800; // Max risk score (0-1000)
    uint256 public liquidationThreshold = 900; // Auto-liquidation threshold
    uint256 public warningThreshold = 700; // Warning threshold
    uint256 public maxConcentration = 300; // Max 30% in single asset
    uint256 public minLiquidity = 100; // Min liquidity score
    
    // Protocol risk weights (0-1000)
    mapping(string => uint256) public protocolRiskWeights;
    mapping(address => uint256) public tokenRiskWeights;
    
    uint256 public totalAssessments;
    uint256 public totalAlertsIssued;
    uint256 public totalLiquidations;
    
    address public emergencyManager;
    
    constructor(address _emergencyManager) Ownable(msg.sender) {
        emergencyManager = _emergencyManager;
        
        // Initialize protocol risk weights
        protocolRiskWeights["Aave"] = 200; // Low risk
        protocolRiskWeights["Compound"] = 250; // Low-medium risk
        protocolRiskWeights["Uniswap"] = 400; // Medium risk
        protocolRiskWeights["Curve"] = 300; // Medium-low risk
        protocolRiskWeights["Sushiswap"] = 450; // Medium-high risk
        protocolRiskWeights["Unknown"] = 800; // High risk
    }
    
    /**
     * @dev Evaluate risk for a user's portfolio
     * @param user The user address to assess
     * @return riskScore The calculated risk score (0-1000)
     * @return riskLevel The risk level string
     */
    function evaluateRisk(address user) external returns (uint256 riskScore, string memory riskLevel) {
        require(user != address(0), "Invalid user address");
        
        // Calculate comprehensive risk metrics
        RiskMetrics memory metrics = _calculateRiskMetrics(user);
        
        // Determine overall risk score
        riskScore = _calculateOverallRiskScore(metrics);
        riskLevel = _getRiskLevel(riskScore);
        
        // Store assessment
        userRiskAssessments[user] = RiskAssessment({
            riskScore: riskScore,
            riskLevel: riskLevel,
            portfolioValue: metrics.totalValue,
            volatilityScore: metrics.volatilityScore,
            concentrationRisk: _calculateConcentrationRisk(user),
            liquidityRisk: _calculateLiquidityRisk(user),
            timestamp: block.timestamp
        });
        
        userRiskMetrics[user] = metrics;
        totalAssessments++;
        
        // Check for risk alerts
        _checkRiskAlerts(user, riskScore);
        
        emit RiskAssessed(user, riskScore, riskLevel, metrics.totalValue, block.timestamp);
        
        return (riskScore, riskLevel);
    }
    
    /**
     * @dev Calculate comprehensive risk metrics
     */
    function _calculateRiskMetrics(address user) internal view returns (RiskMetrics memory) {
        Position[] memory positions = userPositions[user];
        
        if (positions.length == 0) {
            return RiskMetrics({
                totalValue: 0,
                riskScore: 0,
                diversificationScore: 1000,
                liquidityScore: 1000,
                volatilityScore: 0,
                protocolRiskScore: 0
            });
        }
        
        uint256 totalValue = 0;
        uint256 weightedRisk = 0;
        uint256 protocolRisk = 0;
        
        // Calculate position-weighted risks
        for (uint i = 0; i < positions.length; i++) {
            Position memory pos = positions[i];
            totalValue += pos.value;
            
            // Token risk
            uint256 tokenRisk = tokenRiskWeights[pos.token];
            if (tokenRisk == 0) tokenRisk = 500; // Default medium risk
            
            // Protocol risk
            uint256 protocolWeight = protocolRiskWeights[pos.protocol];
            if (protocolWeight == 0) protocolWeight = 800; // Default high risk
            
            weightedRisk += (pos.value * tokenRisk) / 1000;
            protocolRisk += (pos.value * protocolWeight) / 1000;
        }
        
        // Normalize by total value
        if (totalValue > 0) {
            weightedRisk = (weightedRisk * 1000) / totalValue;
            protocolRisk = (protocolRisk * 1000) / totalValue;
        }
        
        return RiskMetrics({
            totalValue: totalValue,
            riskScore: weightedRisk,
            diversificationScore: _calculateDiversificationScore(positions),
            liquidityScore: _calculateLiquidityScore(positions),
            volatilityScore: _calculateVolatilityScore(positions),
            protocolRiskScore: protocolRisk
        });
    }
    
    /**
     * @dev Calculate overall risk score from metrics
     */
    function _calculateOverallRiskScore(RiskMetrics memory metrics) internal pure returns (uint256) {
        // Weighted combination of risk factors
        uint256 riskScore = (
            metrics.riskScore * 30 +
            (1000 - metrics.diversificationScore) * 25 +
            (1000 - metrics.liquidityScore) * 20 +
            metrics.volatilityScore * 15 +
            metrics.protocolRiskScore * 10
        ) / 100;
        
        return riskScore > 1000 ? 1000 : riskScore;
    }
    
    /**
     * @dev Calculate diversification score
     */
    function _calculateDiversificationScore(Position[] memory positions) internal pure returns (uint256) {
        if (positions.length <= 1) return 0;
        
        // Simple diversification based on number of positions and concentration
        uint256 baseScore = positions.length * 100;
        if (baseScore > 800) baseScore = 800;
        
        // Bonus for having positions across different protocols
        uint256 protocolCount = 1; // Simplified - would need proper counting
        uint256 protocolBonus = protocolCount * 50;
        
        uint256 totalScore = baseScore + protocolBonus;
        return totalScore > 1000 ? 1000 : totalScore;
    }
    
    /**
     * @dev Calculate liquidity score
     */
    function _calculateLiquidityScore(Position[] memory positions) internal pure returns (uint256) {
        // Mock liquidity calculation
        // In real implementation, would check DEX liquidity, trading volumes, etc.
        uint256 totalLiquidity = 0;
        
        for (uint i = 0; i < positions.length; i++) {
            // Mock: larger positions assumed to have better liquidity
            uint256 positionLiquidity = positions[i].value > 1000e18 ? 800 : 600;
            totalLiquidity += positionLiquidity;
        }
        
        return positions.length > 0 ? totalLiquidity / positions.length : 1000;
    }
    
    /**
     * @dev Calculate volatility score
     */
    function _calculateVolatilityScore(Position[] memory positions) internal view returns (uint256) {
        // Mock volatility calculation based on token types and time
        uint256 totalVolatility = 0;
        
        for (uint i = 0; i < positions.length; i++) {
            // Mock: newer positions are more volatile
            uint256 timeScore = block.timestamp - positions[i].entryTime;
            uint256 volatility = timeScore < 86400 ? 600 : 300; // Higher if < 1 day
            totalVolatility += volatility;
        }
        
        return positions.length > 0 ? totalVolatility / positions.length : 0;
    }
    
    /**
     * @dev Calculate concentration risk
     */
    function _calculateConcentrationRisk(address user) internal view returns (uint256) {
        Position[] memory positions = userPositions[user];
        if (positions.length == 0) return 0;
        
        uint256 totalValue = 0;
        uint256 maxPositionValue = 0;
        
        for (uint i = 0; i < positions.length; i++) {
            totalValue += positions[i].value;
            if (positions[i].value > maxPositionValue) {
                maxPositionValue = positions[i].value;
            }
        }
        
        if (totalValue == 0) return 0;
        
        uint256 concentration = (maxPositionValue * 1000) / totalValue;
        return concentration > maxConcentration ? concentration - maxConcentration : 0;
    }
    
    /**
     * @dev Calculate liquidity risk
     */
    function _calculateLiquidityRisk(address user) internal view returns (uint256) {
        Position[] memory positions = userPositions[user];
        if (positions.length == 0) return 0;
        
        uint256 totalRisk = 0;
        
        for (uint i = 0; i < positions.length; i++) {
            // Mock liquidity risk calculation
            uint256 positionRisk = positions[i].value < 1000e18 ? 400 : 200;
            totalRisk += positionRisk;
        }
        
        return totalRisk / positions.length;
    }
    
    /**
     * @dev Get risk level string from score
     */
    function _getRiskLevel(uint256 riskScore) internal pure returns (string memory) {
        if (riskScore <= 200) return "Very Low";
        if (riskScore <= 400) return "Low";
        if (riskScore <= 600) return "Medium";
        if (riskScore <= 800) return "High";
        return "Very High";
    }
    
    /**
     * @dev Check and issue risk alerts
     */
    function _checkRiskAlerts(address user, uint256 riskScore) internal {
        if (riskScore >= liquidationThreshold) {
            _issueLiquidationAlert(user, riskScore);
        } else if (riskScore >= warningThreshold) {
            _issueWarningAlert(user, riskScore);
        }
    }
    
    /**
     * @dev Issue liquidation alert
     */
    function _issueLiquidationAlert(address user, uint256 riskScore) internal {
        riskAlerts[user] = true;
        totalAlertsIssued++;
        
        emit RiskAlert(
            user,
            "LIQUIDATION_REQUIRED",
            riskScore,
            liquidationThreshold,
            "Immediate position reduction required",
            block.timestamp
        );
    }
    
    /**
     * @dev Issue warning alert
     */
    function _issueWarningAlert(address user, uint256 riskScore) internal {
        totalAlertsIssued++;
        
        emit RiskAlert(
            user,
            "HIGH_RISK_WARNING",
            riskScore,
            warningThreshold,
            "Consider reducing position sizes",
            block.timestamp
        );
    }
    
    /**
     * @dev Add position for user (called by other contracts)
     */
    function addPosition(
        address user,
        address token,
        uint256 amount,
        uint256 value,
        string memory protocol
    ) external {
        userPositions[user].push(Position({
            token: token,
            amount: amount,
            value: value,
            protocol: protocol,
            entryTime: block.timestamp,
            riskWeight: tokenRiskWeights[token] > 0 ? tokenRiskWeights[token] : 500
        }));
    }
    
    /**
     * @dev Update risk parameters
     */
    function updateRiskParameters(
        uint256 _maxRiskScore,
        uint256 _liquidationThreshold,
        uint256 _warningThreshold
    ) external onlyOwner {
        require(_maxRiskScore <= 1000, "Invalid max risk score");
        require(_liquidationThreshold <= 1000, "Invalid liquidation threshold");
        require(_warningThreshold <= 1000, "Invalid warning threshold");
        require(_warningThreshold < _liquidationThreshold, "Warning must be less than liquidation");
        
        maxRiskScore = _maxRiskScore;
        liquidationThreshold = _liquidationThreshold;
        warningThreshold = _warningThreshold;
        
        emit RiskParametersUpdated(_maxRiskScore, _liquidationThreshold, _warningThreshold);
    }
    
    /**
     * @dev Update protocol risk weight
     */
    function updateProtocolRiskWeight(string memory protocol, uint256 weight) external onlyOwner {
        require(weight <= 1000, "Weight cannot exceed 1000");
        protocolRiskWeights[protocol] = weight;
    }
    
    /**
     * @dev Update token risk weight
     */
    function updateTokenRiskWeight(address token, uint256 weight) external onlyOwner {
        require(weight <= 1000, "Weight cannot exceed 1000");
        tokenRiskWeights[token] = weight;
    }
    
    /**
     * @dev Get user risk assessment
     */
    function getUserRiskAssessment(address user) external view returns (RiskAssessment memory) {
        return userRiskAssessments[user];
    }
    
    /**
     * @dev Get user positions
     */
    function getUserPositions(address user) external view returns (Position[] memory) {
        return userPositions[user];
    }
    
    /**
     * @dev Get contract statistics
     */
    function getStats() external view returns (
        uint256 _totalAssessments,
        uint256 _totalAlerts,
        uint256 _totalLiquidations,
        uint256 _activeAlerts
    ) {
        // Count active alerts (simplified)
        uint256 activeAlerts = 0; // Would need proper counting in real implementation
        
        return (totalAssessments, totalAlertsIssued, totalLiquidations, activeAlerts);
    }
}

contracts/YieldOptimizer.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.20;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/ReentrancyGuard.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

/**
 * @title YieldOptimizer
 * @dev Smart contract for LokiAI Yield Optimization Agent
 * Finds and executes optimal yield farming strategies across DeFi protocols
 */
contract YieldOptimizer is Ownable, ReentrancyGuard {
    
    // Events
    event YieldOptimized(
        address indexed user,
        address indexed token,
        uint256 amount,
        uint256 apy,
        string protocol,
        uint256 timestamp
    );
    
    event StrategyExecuted(
        address indexed user,
        string strategy,
        uint256 inputAmount,
        uint256 outputAmount,
        uint256 timestamp
    );
    
    event ProtocolAdded(string protocol, address protocolAddress, bool active);
    event ProtocolUpdated(string protocol, bool active);
    
    // Structs
    struct YieldStrategy {
        string name;
        address protocol;
        uint256 apy;
        uint256 tvl;
        uint256 riskScore;
        bool active;
    }
    
    struct UserPosition {
        address token;
        uint256 amount;
        string protocol;
        uint256 entryTime;
        uint256 expectedApy;
    }
    
    // State variables
    mapping(string => YieldStrategy) public strategies;
    mapping(address => UserPosition[]) public userPositions;
    mapping(string => address) public protocolAddresses;
    
    string[] public availableStrategies;
    uint256 public totalValueLocked;
    uint256 public totalUsersServed;
    uint256 public performanceFee = 100; // 1% in basis points
    
    address public feeRecipient;
    
    constructor(address _feeRecipient) Ownable(msg.sender) {
        feeRecipient = _feeRecipient;
        
        // Initialize with mock strategies
        _addStrategy("Aave USDC", address(0x1), 450, 1000000e6, 2, true); // 4.5% APY
        _addStrategy("Compound ETH", address(0x2), 380, 500000e18, 3, true); // 3.8% APY
        _addStrategy("Curve 3Pool", address(0x3), 520, 2000000e18, 1, true); // 5.2% APY
    }
    
    /**
     * @dev Execute yield optimization for a user
     * @param user The user address to optimize for
     * @param token The token to optimize
     * @param amount The amount to optimize
     * @return apy The achieved APY
     * @return protocol The selected protocol
     */
    function executeOptimization(
        address user,
        address token,
        uint256 amount
    ) external nonReentrant returns (uint256 apy, string memory protocol) {
        require(user != address(0), "Invalid user address");
        require(token != address(0), "Invalid token address");
        require(amount > 0, "Amount must be greater than 0");
        
        // Find best strategy (mock implementation)
        (apy, protocol) = _findBestStrategy(token, amount);
        
        // Execute strategy (mock implementation)
        _executeStrategy(user, token, amount, protocol);
        
        // Update user position
        userPositions[user].push(UserPosition({
            token: token,
            amount: amount,
            protocol: protocol,
            entryTime: block.timestamp,
            expectedApy: apy
        }));
        
        // Update metrics
        totalValueLocked += amount;
        totalUsersServed++;
        
        emit YieldOptimized(user, token, amount, apy, protocol, block.timestamp);
        
        return (apy, protocol);
    }
    
    /**
     * @dev Find the best yield strategy for given parameters
     * @param token The token to find strategy for
     * @param amount The amount to invest
     * @return bestApy The best APY found
     * @return bestProtocol The protocol offering best APY
     */
    function _findBestStrategy(
        address token,
        uint256 amount
    ) internal view returns (uint256 bestApy, string memory bestProtocol) {
        bestApy = 0;
        bestProtocol = "";
        
        // Mock strategy selection logic
        for (uint i = 0; i < availableStrategies.length; i++) {
            string memory strategyName = availableStrategies[i];
            YieldStrategy memory strategy = strategies[strategyName];
            
            if (strategy.active && strategy.apy > bestApy) {
                // Add some randomness based on block data
                uint256 adjustedApy = strategy.apy + (block.timestamp % 100);
                if (adjustedApy > bestApy) {
                    bestApy = adjustedApy;
                    bestProtocol = strategyName;
                }
            }
        }
        
        // Ensure minimum APY
        if (bestApy == 0) {
            bestApy = 300 + (block.timestamp % 200); // 3-5% fallback
            bestProtocol = "Default Strategy";
        }
    }
    
    /**
     * @dev Execute the selected strategy (mock implementation)
     */
